import React from 'react';
import logo from '../assests/log.png';
import '../App.css';
import banner from "../assests/ban.png";


import { Link } from "react-router-dom";

function LogoutNow() {
  alert("You have Successfully Logged Out. Hope to see you again.")
  localStorage.removeItem("IsSignIn");
  window.location.reload();
}

function Nav({IsSignIn, setIsSignIn}) {
  
	return (
<>
    {IsSignIn ? (

  <>
  <section className="header">
  <nav >
  <a href="./"><img src={logo} className="logo" alt=""></img></a>
  
  
	<div className= "nav-links">
  <ul>
  <li><a href="../">Home</a></li>
    <li><a href="../about">About</a></li>
    <li><a href="../careers">Careers</a></li>
    <li><button onClick={LogoutNow} >Logout</button></li>

  </ul>
</div>

</nav>

</section>
</>
      ) : (

		<>
	<section className="header">
  
    <nav >
    
  <a href="./"><img src={logo} className="logo" alt=""></img></a>
  
  
  <div className="nav-links">
  <i className="fa fa-times"></i>
  <ul >
  <li><a href="/">Home</a></li>
    <li><a href="/about">About</a></li>
    <li><a href="./careers">Careers</a></li>
  
   <li className="login-btn"><a href="./register">Join</a></li>
   
   
  </ul>
  </div>
  <i class="fa fa-bars"></i>
    </nav>
   
    
    <div className="area"><img src={banner} alt="Dcipl Banner" ></img>
            </div>
    <div className="text-box">
        <h1>Your Smart Financial Planner</h1></div>
        <div className="btn">
        <button type="submit" to="./register"><Link to="./register"><strong>PLAN NOW</strong></Link></button>
        </div>
  </section>
  
   

</>

      )}
</>
		)
};

export default Nav;
